import React from 'react'
import ProductCard from './ProductCard'

const ProductsList = () => {
  return (
    <>
        <ProductCard imgName='arm-chair-01.jpg'/>
        <ProductCard imgName='table.jpg'/>
        <ProductCard imgName='single-sofa-03.jpg'/>
        <ProductCard imgName='arm-chair-03.jpg'/>
    </>
  )
}

export default ProductsList
